INSERT INTO `Service` VALUES ('00505151-1f08-4d17-84a7-db8cd7e54fb5',NULL,NULL,'عيادة الدكتور إسلام بردله، استشاري علاج السمنة وتنسيق القوام في كوم حمادة. نقدم حلولاً متكاملة لإنقاص الوزن، بما في ذلك الأنظمة الغذائية، الأجهزة الموضعية لتفتيت الدهون، وبرامج المتابعة للحفاظ على النتائج. Dr. Islam Bardala\'s clinic, a consultant in obesity treatment and body contouring in Kom Hamada, offers integrated weight loss solutions including diet plans, local fat reduction devices, and follow-up programs to maintain results. تخسيس، نحت الجسم، دايت، سمنة موضعية. Keywords: weight loss consultant, body contouring, obesity treatment, dietetics, non-surgical slimming, Kom Hamada, استشاري سمنة، تنسيق قوام، تخسيس، علاج السمنة الموضعية، أنظمة غذائية.','01011234601','Kom Hamada',31.0345728,30.4676864,NULL,NULL,'EGP',1,'b1d1bba6-3807-4036-bfcc-3dadf3ae17d9','0060015a-07df-46e1-a23d-11dc5e52682e','2025-09-09 21:01:04.236','2025-09-10 14:33:31.041',NULL,'906b9da0-262f-4a29-9bca-0bf8455f0e96'),('0142ffde-0d75-4612-9912-cbcb3f354673',NULL,NULL,'Awlad Qutb Exhibition is a comprehensive home goods store in Kom Hamada, located on Al Masnaa Street. We offer a wide range of household items, from kitchenware to home decor and furnishings. معرض أولاد قطب يوفر لكم كل مستلزمات المنزل في مكان واحد. تجدون لدينا أدوات المطبخ، المفروشات، الديكورات المنزلية، والعديد من المنتجات الأخرى. نوفر خدمة التوصيل لراحة عملائنا. We are committed to providing quality products that make your house a home. Keywords: home goods store, household items, kitchenware, home decor, furnishings, Kom Hamada, delivery service, متجر مستلزمات للمنزل, أدوات منزلية, أدوات مطبخ, مفروشات, ديكور, توصيل.','','كوم حمادة',31.0345728,30.4676864,NULL,NULL,'EGP',1,'b9a16d4c-38a6-4323-af8d-d9df07a70774','234330a4-934c-4d9f-b120-6149e7959492','2025-09-09 21:00:16.596','2025-09-10 14:33:31.041',NULL,'d04c49f4-1c1f-41bb-a9de-4a6c93ebb10f'),('0179abe2-224b-4363-a1f9-0dc5ae3b96e9',NULL,NULL,'مركز الريادة للمستلزمات الطبية (Al-Reyada Center for Medical Supplies) is a professional medical equipment supplier serving the Itay Al-Barud region. We provide high-quality medical devices, hospital furniture, and clinical supplies to healthcare facilities. Our catalog includes everything from diagnostic equipment to surgical instruments. We are a reliable partner for clinics and hospitals seeking quality and value. Contact us at 01068599980. مركز الريادة هو مورد معدات طبية محترف. نوفر أجهزة طبية عالية الجودة، أثاث مستشفيات، ومستلزمات سريرية للمرافق الصحية. يشمل كتالوجنا كل شيء من معدات التشخيص إلى الأدوات الجراحية. نحن شريك موثوق للعيادات والمستشفيات. Keywords: medical equipment supplier, medical devices, hospital furniture, clinical supplies, Al-Reyada Center, Itay Al-Barud, مورد معدات طبية, أجهزة طبية, أثاث مستشفيات, مستلزمات عيادات.','01068599980','Itay Al-Barud',31.0345728,30.4676864,NULL,NULL,'EGP',1,'ce4276c8-8401-4721-b0e7-dbd17238af02','0802b84e-5392-47f1-8bd6-da625fb5e6fd','2025-09-09 21:00:37.715','2025-09-10 14:33:31.041',NULL,'2aba3f0f-a6d8-4797-b194-3943a9848b51'),('024ecc34-8af6-4cbb-958c-5e88391024aa',NULL,NULL,'Al-Tawil Furniture Exhibition, located in the village of Al-Najah, offers a wide selection of home furniture. We are known for our excellent customer service and good ethics, as one customer noted, \'And yes, the morals.\' معرض الطويل للاثاث في قرية النجاح يقدم لكم موبيليا وأثاث منزلي بجودة عالية وتعامل راقٍ. سواء كنتم تبحثون عن غرف نوم، صالونات أو أي أثاث آخر، ستجدون لدينا ما يسركم. We pride ourselves on creating a trustworthy and pleasant shopping experience for everyone in the community. Keywords: furniture store, home furniture, Al-Najah, Kom Hamada, customer service, good ethics, mobilya, rural furniture store, متجر أثاث, موبيليا, قرية النجاح, خدمة عملاء, ونعم الأخلاق, أثاث منزلي.','','قرية النجاح',31.0345728,30.4676864,NULL,NULL,'EGP',1,'b9a16d4c-38a6-4323-af8d-d9df07a70774','f74666c3-bef5-4681-b310-0ae68e2b2a8b','2025-09-09 21:00:16.668','2025-09-10 14:33:31.041',NULL,'2129af34-a3d1-4f69-b