INSERT INTO `service_translation` VALUES ('002f2958-f5c8-40f2-a118-1c712c76e575','European-Standard Courses','دورات بمعايير أوروبية','An educational center, potentially offering courses aligned with European (EU) standards.','مركز تعليمي، قد يقدم دورات تتماشى مع المعايير الأوروبية (EU).','2025-09-09 21:00:06.213','2025-09-09 21:00:06.213'),('005d1257-250b-4486-81f6-75966aa10d80','Dr. Ahmed Ibrahim Selim Clinic for Pediatrics and Neonatology','عيادة دكتور أحمد إبراهيم سليم لطب الأطفال وحديثي الولادة','An excellent and knowledgeable pediatrician\'s clinic specializing in the care of children and newborns.','عيادة طبيب أطفال ممتازة وذات دراية متخصصة في رعاية الأطفال وحديثي الولادة.','2025-09-09 21:01:04.365','2025-09-09 21:01:04.365'),('00e4b174-1710-4dfc-80a2-1ccbc9771dc4','Dr. Ramy Abu Khatwa Center','مركز د.رامي أبو خطوه','Specialized clinic for obstetrics and gynecology services, including pregnancy follow-up, delivery, and women\'s health issues.','عيادة متخصصة في خدمات أمراض النساء والتوليد، بما في ذلك متابعة الحمل والولادة وقضايا صحة المرأة.','2025-09-09 21:01:03.708','2025-09-09 21:01:03.708'),('01178d65-6c32-4b14-b732-0a7c7fa122e6','Dr. Mahmoud Clinic','عيادة دكتور محمود','A pediatrician\'s clinic dedicated to the health and well-being of children.','عيادة طبيب أطفال مخصصة لصحة ورفاهية الأطفال.','2025-09-09 21:01:04.396','2025-09-09 21:01:04.396'),('01b62a8e-ad63-41d2-a242-ef46db12608c','Electrical Appliance Maintenance','صيانة الأجهزة الكهربائية','Gamal El-Zeiny for electrical appliance maintenance. We offer very beautiful and professional repair services.','جمال الزيني لصيانة الأجهزة الكهربائية. نقدم خدمات إصلاح جميلة جداً واحترافية.','2025-09-09 21:00:25.904','2025-09-09 21:00:25.904'),('01d7a813-d446-40e3-bdbb-1a1207300e31','Household Goods and Electrical Appliances','أدوات منزلية وأجهزة كهربائية','Al-Saif Company for household goods and electrical appliances. We offer a delivery service for your convenience.','شركة السيف للأدوات المنزلية والأجهزة الكهربائ